import React from 'react';
import '../style/App.css';

export default function Accountinfo1(props) {
    return (
        <div>
            <div className="row"><h2>Your account</h2></div>
            <div className="row">

                <h3>Username: {props.username}</h3>
            </div>
        </div>
    )
}
